import {StyleSheet,View,ScrollView,Dimensions,Image,Button, Text} from 'react-native';
import {Header} from 'react-native-elements';
import CarouselScreen from './CarouselScreen'
import PetfitDetails from './PetfitDetails'
import * as React from 'react';
function HeaderMenu({navigation}){
return(
<View style={{backgroundColor:'grey'}}>
<Header leftComponent={{ icon: 'menu', color: '#fff',onPress:()=>navigation.toggleDrawer()
 
}}
centerComponent={{ text: 'PetFit', style: { color: '#fff' } }}
containerStyle={{
backgroundColor: 'black',
justifyContent: 'space-around',
 }}
/>
 <CarouselScreen/>
 <PetfitDetails/>
</View>
 );
}
export default HeaderMenu
